import styled from 'styled-components';
import { dark_grey } from "../constants.styled";

const Navbar = styled.div`
    display: flex;
    width: 100%;
    height: 60px;

    li {
      padding: 0 20px;
    }
`;

const MenuListLeft = styled.ul`
    display: flex;
    list-style-type: none;
    padding-left: 0;
    font-size: 14px;
    font-weight: 500;
    color: ${dark_grey};
    letter-spacing: .3px;
`;

const MenuListRight = styled.ul`
    display: flex;
    list-style-type: none;
    padding-left: 0;
    font-family: 'Themify';
`;

export default {
    MenuListLeft,
    MenuListRight,
    Navbar
}
